import Header from "./components/Header";
import Posts from "./components/Posts";
import Footer from "./components/Footer";
import Form from "./components/Form";
import Settings from "./components/Settings";

import { useState } from "react";
import uuid from "react-uuid";

export default function App() {
  // const handleSubmit = (event) => {
  //   event.preventDefault();
  //   console.log('Data sent!');
  // }

  // const handleClick = () => {
  //   console.log('Button clicked');
  // }
  const initialPosts = [
    {
      id: uuid(),
      title: 'The White Mountain',
      description: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Maecenas a risus odio. Donec quis tortor ornare, ultricies nulla id, consequat urna. In vitae lobortis sapien, nec posuere libero.',
      category: 'ent',
      promote: true,
      status: 'p',
      picture: 'data:image/jpeg;base64,',
      likes: 0,
      dislikes: 0
    },
    {
      id: uuid(),
      title: 'Road to Somewhere',
      description: 'Nunc vehicula vel dui et pellentesque. Integer volutpat sed tortor eu tristique. Duis non tempor odio, vitae tempor est.',
      category: 'edu',
      promote: false,
      status: 'p',
      // Option + Z
      picture: 'data:image/jpeg;base64,',
      likes: 15,
      dislikes: 2
    },
    {
      id: uuid(),
      title: 'Follow the Flow',
      description: 'Phasellus aliquet iaculis lorem quis lacinia. Phasellus dolor leo, faucibus vel vestibulum sit amet, pharetra et sapien. Donec pretium viverra quam.',
      category: 'ent',
      promote: false,
      status: 'a',
      picture: 'data:image/jpeg;base64,',
      likes: 10,
      dislikes: 6
    }
  ];
  const [posts, setPosts] = useState(initialPosts);

  const handleAddPost = (title, description, category, promote, status, picture) => {
    const updatedPosts = [...posts];
    updatedPosts.push(
      {
        id: uuid(),
        title,
        description,
        category,
        promote,
        status,
        picture,
        likes: 0,
        dislikes: 0
      }
    );
    setPosts(updatedPosts);
  }

  // Update the number of likes.
  const handlePostLike = (id) => {
    const updatedPosts = [...posts];
    updatedPosts.forEach((post) => {
      if (post.id === id) {
        post.likes++;
      }
    });
    setPosts(updatedPosts);
  }

  // Update the number of dislikes.
  const handlePostDislike = (id) => {
    const updatedPosts = [...posts];
    updatedPosts.forEach((post) => {
      if (post.id === id) {
        post.dislikes++;
      }
    });
    setPosts(updatedPosts);
  }

  return (
    <>
      <Header />
      <Posts 
        posts={posts} 
        onPostLike={handlePostLike}
        onPostDislike={handlePostDislike}
      />
      <Form 
        onAddPost={handleAddPost}
      />
      <Settings />
      <Footer />
    </>
  );
}